webpackJsonp([11,428],{1676:function(e,r,t){e.exports={frontmatter:t(683),content:t(2864)}},2864:function(e,r,t){e.exports="<p>Denne teksten er en oversettelse av en originaltekst fra <a href=http://thinkersmith.org/ >ThinkerSmith</a>, og er lisensiert i henhold til retningslinjene nederst på siden.</p> <section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>Mine Robotvenner introduserer elevene for prinsippene bak programmering, og illustrerer behovet for funksjoner.</p> <p>Ved å bruke et forhåndsdefinert <em>robotordforråd</em> skal elevene styre hverandre gjennom forskjellige oppgaver, uten å diskutere dem først. Dette lærer elevene sammenhengen mellom symboler og handlinger, i tillegg til å gi verdifull innsikt i feilsøking.</p> <p>Beregnet gjennomføringstid er 1 time per klasse. Beregnet forberedelsestid: 10 minutter.</p> <figure><img src="+t(3597)+' alt=""></figure> </section> <section class=activity id=laeringsmal> <h1 class=activity id=laeringsmal>Læringsmål</h1> <section class=check id=elevene-skal> <h2 class=check id=elevene-skal>Elevene skal</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_0><label for=cbx_0> Lære å omgjøre virkelige handlinger til instruksjoner.</label></li> <li class=task-list-item><input type=checkbox id=cbx_1><label for=cbx_1> Få praktisk erfaring i å kode med symboler.</label></li> <li class=task-list-item><input type=checkbox id=cbx_2><label for=cbx_2> Oppnå en forståelse for nødvendigheten av presisjon innen koding.</label></li> <li class=task-list-item><input type=checkbox id=cbx_3><label for=cbx_3> Erfare hvordan feilsøking gjøres for å finne feil i koden.</label></li> <li class=task-list-item><input type=checkbox id=cbx_4><label for=cbx_4> Forstå hvor nyttige funksjoner og parametere er (trinn 7+).</label></li> </ul> </section> </section> <section class=activity id=materiell-og-forberedelser> <h1 class=activity id=materiell-og-forberedelser>Materiell og forberedelser</h1> <section class=check id=materiell> <h2 class=check id=materiell>Materiell</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_5><label for=cbx_5> Symbolark (1 per gruppe), <a href=robotvenner_symbolark.pdf>last ned her</a>.</label></li> <li class=task-list-item><input type=checkbox id=cbx_6><label for=cbx_6> Pakke med koppestablefigurer (1 per gruppe), <a href=robotvenner_figurer.pdf>last ned her</a>.</label></li> <li class=task-list-item><input type=checkbox id=cbx_7><label for=cbx_7> Engangskopper eller <a href=robotvenner_trapeser.pdf>papirtrapeser</a> (6 eller flere per gruppe).</label></li> <li class=task-list-item><input type=checkbox id=cbx_8><label for=cbx_8> Blanke ark eller notatkort (1 per person).</label></li> <li class=task-list-item><input type=checkbox id=cbx_9><label for=cbx_9> Noe å skrive med (1 per person).</label></li> </ul> </section> <section class=check id=forberedelser> <h2 class=check id=forberedelser>Forberedelser</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_10><label for=cbx_10> Skriv ut ett <a href=robotvenner_symbolark.pdf>symbolark</a> til hver gruppe.</label></li> <li class=task-list-item><input type=checkbox id=cbx_11><label for=cbx_11> Skriv ut arket med <a href=robotvenner_trapeser.pdf>trapesfigurer</a>, om kopper ikke brukes.</label></li> <li class=task-list-item><input type=checkbox id=cbx_12><label for=cbx_12> Plassér koppene eller papirtrapesene på et eget bord litt unna der gruppene skal være (dette er <em>robotbiblioteket</em>).</label></li> </ul> </section> <section class=check id=ordforrad> <h2 class=check id=ordforrad>Ordforråd</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_13><label for=cbx_13> <em>Algoritme</em> – en serie av instruksjoner som beskriver hvordan en kan oppnå et mål.</label></li> <li class=task-list-item><input type=checkbox id=cbx_14><label for=cbx_14> <em>Koding</em> – Omgjøre handlinger til et symbolspråk.</label></li> <li class=task-list-item><input type=checkbox id=cbx_15><label for=cbx_15> <em>Feilsøking</em> – Finne og rette feil og problemer i koden.</label></li> <li class=task-list-item><input type=checkbox id=cbx_16><label for=cbx_16> <em>Funksjon</em> – Kode som kan brukes om og om igjen.</label></li> <li class=task-list-item><input type=checkbox id=cbx_17><label for=cbx_17> <em>Parameter</em> - Ekstra informasjon som kan legges til en funksjon, for å tilpasse den.</label></li> </ul> </section> </section> <section class=activity id=gjennomforing> <h1 class=activity id=gjennomforing>Gjennomføring</h1> <section id=introduksjon-2> <h2 id=introduksjon-2>Introduksjon</h2> <p>Begynn med å spørre klassen om noen har hørt om roboter. Om noen har sett eller tatt på en robot? Kan en sånn maskin <em>høre</em> deg snakke? <em>Forstår</em> den faktisk det som blir sagt? Svaret på det siste spørsmålet er: <em>Ikke på samme måte som et menneske gjør</em>.</p> <p>Roboter trenger en serie med <em>instruksjoner</em>, spesifikke ting de har blitt satt til å gjøre. For å kunne gjennomføre en oppgave trenger en robot en rekke med instruksjoner (ofte kalt en algoritme) den kan utføre. I dag skal vi lære hva som trengs for å få dette til.</p> </section> <section id=start> <h2 id=start>Start</h2> <p>Vis frem en kopi av <a href=robotvenner_symbolark.pdf>symbolarket</a> (eller skriv symbolene på tavlen). Fortell at det kun er lov å bruke disse seks symbolene i denne oppgaven. I denne utfordringen skal elevene instruere sin <em>robot</em> (en annen elev) til å bygge en gitt stabel med kopper ved å kun bruke disse gitte instruksjonene.</p> </section> <section class=protip id=tilpasninger> <h2 class=protip id=tilpasninger>Tilpasninger</h2> <section id=barnehagen-og-smaskolen> <h3 id=barnehagen-og-smaskolen>Barnehagen og småskolen</h3> <ul> <li>Gjør oppgaven med alle barna/elevene samlet. La barna/elevene gi instruksjoner som læreren skal skrive ned.</li> <li>La en (voksen) assistent være roboten. Assistenten forlater rommet mens barna/elevene programmerer, for så å komme tilbake og prøve å utføre koden.</li> <li>Om det er nok tid bytter assistenten og læreren plass. Assistenten programmerer sammen med barna/elevene, mens læreren utfører koden i etterkant.</li> </ul> </section> <section id=mellomtrinnet> <h3 id=mellomtrinnet>Mellomtrinnet</h3> <ul> <li>Del inn i grupper på 3 til 5 tilpasset hvordan klassen samarbeider.</li> <li>Forvent at alle har lyst å prøve å være robot, slik at dette vil sannsynligvis bruke hele timen.</li> </ul> </section> <section id=ungdomsskolen-og-videregaende> <h3 id=ungdomsskolen-og-videregaende>Ungdomsskolen og videregående</h3> <ul> <li>Del inn i grupper på maksimalt fire elever, tre i hver gruppe er ideelt.</li> <li>Elevene får da nok tid til at alle får prøvd seg som robot, og kan også prøve seg på ekstraoppgavene om funksjoner som står beskrevet lenger ned.</li> </ul> </section> </section> <section id=komme-i-gang> <h2 id=komme-i-gang>Komme i gang</h2> <ul> <li> <p>Velg en elev til å være <em>robot</em> i hver gruppe.</p> </li> <li> <p>Send roboten til <em>robotbiblioteket</em>, mens resten av gruppen er programmererne som koder.</p> </li> <li> <p>Velg en figur fra <a href=robotvenner_figurer.pdf>koppestablefigurene</a> for hver gruppe.</p> </li> <li> <p>Gruppene skal lage en algoritme for hvordan roboten skal bygge den utvalgte stabelen.</p> </li> <li> <p>De som koder skal oversette algoritmen sin til piler, som beskrevet på <a href=robotvenner_symbolark.pdf>symbolarket</a>.</p> </li> <li> <p>Når programmererne er ferdig med koden henter de roboten sin.</p> </li> <li> <p>Roboten leser pilene på arket og prøver å gjennomføre koden med bevegelser.</p> </li> <li> <p>Resten av gruppen ser etter feil, samarbeider om å rette feilene i koden, og ber deretter roboten om å kjøre programmet på nytt.</p> <figure><img src='+t(3598)+' alt=""></figure> </li> </ul> </section> <section id=regler> <h2 id=regler>Regler</h2> <ul> <li>Programmererne skal <em>kun</em> benytte de seks pilene på <a href=robotvenner_symbolark.pdf>symbolarket</a>.</li> <li>Koppene skal være hos roboten og ikke tilgjengelig for programmererne under kodingen.</li> <li>Når roboten kommer tilbake til gruppen skal de ikke snakke sammen. Instruksjonene er skrevet på papiret!</li> </ul> <p><em>Om elevene spør om regler som ikke er nevnt over kan du enten definere dem selv basert på egen erfaring, eller be dem å bestemme reglene i gruppa</em>.</p> </section> </section> <section class=activity id=praktisk-eksempel> <h1 class=activity id=praktisk-eksempel>Praktisk eksempel</h1> <p>Det er svært nyttig å gå over et av eksemplene med samlet klasse først. Det er en stabel blant <a href=robotvenner_figurer.pdf>koppestablefigurene</a> som bare inneholder tre kopper. Hold figuren opp for klassen og gå gjennom eksempeløvelsen. En mulig løsning vil se ut som følger.</p> <figure><img src='+t(3589)+' alt=""></figure> <p>Plasser en stabel med kopper på et bord slik atr alle kan se den. Spør klassen om noen kan fortelle hva du skal gjøre først. Gi dem eventuelt et hint om å se på de seks mulige instruksjonene på <a href=robotvenner_symbolark.pdf>symbolarket</a>. Det riktige svaret er <strong>Plukk opp koppen</strong>. Når du plukker en kopp, pass på at den løftes slik at den er høyere enn alle de andre koppene på bordet.</p> <p>Plukk opp den øverste koppen i stabelen, og mens du holder den i luften over stabelen, spør hva som nå skal gjøres med koppen. Koppen må nå flyttes <strong>Ett skritt frem</strong> (eller <strong>Ett skritt tilbake</strong>) minst to ganger. Legg merke til at <strong>Ett skritt</strong> tilsvarer en halv koppelengde, som på figuren under.</p> <figure><img src='+t(3590)+' alt=""></figure> <p>Etter at dere har satt den første koppen på plass kan du gå til tavlen. Utfordre nå klassen til i fellesskap hjelpe deg med å skrive symbolene som behøves for å plassere alle tre koppene. En mulig løsning vil være</p> <figure><img src='+t(3591)+' alt=""></figure> <p>Etter at hele <em>programmet</em> er skrevet ned kan du få en elev til å utføre det, eller du kan kjøre det selv. Si navnet på symbolene høyt etterhvert som du eller eleven flytter på koppene. For eksempel vil programmet ovenfor uttales:</p> <blockquote> <p>Plukk opp koppen. Ett skritt frem. Ett skritt frem. Sett ned koppen. Ett skritt tilbake. Ett skritt tilbake.</p> <p>Plukk opp koppen. Ett skritt frem. Ett skritt frem. Ett skritt frem. Ett skritt frem. Sett ned koppen. Ett skritt tilbake. Ett skritt tilbake. Ett skritt tilbake. Ett skritt tilbake.</p> <p>Plukk opp koppen. Ett skritt frem. Ett skritt frem. Ett skritt frem. Sett ned koppen.</p> </blockquote> </section> <section class=activity id=hovedovelse> <h1 class=activity id=hovedovelse>Hovedøvelse</h1> <section id=del-i-grupper> <h4 id=del-i-grupper>Del i grupper</h4> <p>Del gruppen som tidligere nevnt under <a href=#tilpasninger>Tilpasninger</a>. Målet er å ha nok programmerere i gruppen til at gruppen hele tiden kommer videre.</p> </section> <section id=robot> <h4 id=robot>Robot</h4> <p>Velg en <em>robot</em> i hver gruppe, som skal vente i <em>robotbiblioteket</em>. Dette bør være et sted langt nok unna gruppene slik at ingen roboter får med seg hvilken stabel programmererne jobber med. Robotene kan bruke ventetiden på å øve på å stable kopper eller til å se på reglene og spørre om noe er uklart.</p> </section> <section id=program> <h4 id=program>Program</h4> <p>Hver gruppe bør bare jobbe med en koppestablingsfigur om gangen. De kan begynne med å finne algoritmen for denne stabelen. Hvor mange kopper trenger de? Hvor mange bevegelser må til for å plassere den første koppen? Den neste koppen? Er noen kopper opp ned? Hvordan kan de instruere roboten til å snu koppen?</p> <p>Når de har funnet ut av disse spørsmålene, skal programmererne skrive ned symbolene for å lage koden på arket. Programmererne bør dobbeltsjekke koden sin før de henter roboten fra robotbiblioteket.</p> </section> <section id=kjor-koden> <h4 id=kjor-koden>Kjør koden</h4> <p>Når som roboten kommer tilbake skal alle være stille. Gruppene skal unngå å vise bevegelser eller bruke ord for å hjelpe roboten. Roboten skal bare følge instruksjonene pilene gir. Om gruppen oppdager en feil, kan de stoppe programmet. De sender da roboten tilbake til robotbiblioteket, retter feilen før de henter roboten som prøver å kjøre programmet igjen fra begynnelsen.</p> </section> <section id=gjenta> <h4 id=gjenta>Gjenta</h4> <p>Hver gang en gruppe løser en oppgave velge de en ny robot som sendes til robotbiblioteket. Gruppen starter også med en ny koppestablingsfigur, helst vanskeligere enn den forrige.</p> <p>Dette fortsetter til alle i gruppen har vært robot en gang, man går tom for tid, eller koppestablingsfigurene er vanskelige nok til å snakke om funksjoner (se <a href=#ekstraoppgaver>Ekstraoppgaver</a> nedenfor).</p> </section> <section class=protip id=tips> <h3 class=protip id=tips>Tips</h3> <p>Om gruppene er i ferd med å gå tom for koppestablingsfigurer kan du utfordre dem til å lage sine egne!</p> </section> </section> <section class=activity id=ekstraoppgaver> <h1 class=activity id=ekstraoppgaver>Ekstraoppgaver</h1> <p>Om det er nok tid, så er dette en flott mulighet til å introdusere nyttigheten av <em>funksjoner</em>.</p> <section id=introduksjon-3> <h4 id=introduksjon-3>Introduksjon</h4> <p>Samle klassen og fortell dem at du vil vise dem en spesiell koppestablingsfigur som de skal kode på rekordtid ... Vis dem så dette bildet:</p> <figure><img src='+t(3592)+' alt=""></figure> <p>Du vil mest sannsynlig høre surmuling, fnising og til og med at dette er umulig. Spør klassen hva problemet er? Hvorfor er denne stabelen så problematisk?</p> <p>Denne stabelen virker vanskelig, fordi hver ekstra kopp i bredden legger til to ekstra piler med <strong>Ett skritt frem</strong> og to ekstra piler med <strong>Ett skritt tilbake</strong>. For å skrive kode for denne figuren vil etterhvert instruksjonene se slik ut:</p> <figure><img src='+t(3593)+' alt=""></figure> <p>Ofte vil elevene begynne å forkorte instruksjonene, for eksempel ved å skrive tall etter pilene:</p> <figure><img src='+t(3594)+' alt=""></figure> <p>Under hovedøvelsen anbefales ikke dette. Minn elevene på at de kun skal bruke de seks instruksjonene på symbolarket. Til disse mer kompliserte oppgavene trenger vi kraftigere instruksjoner. Gi elevene ros for at de tenkte selv og oppdaget behovet for funksjoner.</p> </section> <section id=forklar> <h4 id=forklar>Forklar</h4> <p>Vis klassen at en pil etterfulgt av et tall er en smart måte å indikere at en instruksjon skal gjentas flere ganger. Ved å tillate dette, lager vi egentlig bare et nytt symbol som kan brukes for å unngå unødvendig repetisjon. Dette er nettopp ideen bak funksjoner.</p> <p>Utfordre klassen til å finne den lengste rekken med repeterende kode for hver kopp-plassering. Som instruktør kan du godta alle slags grupperinger som gir mening, men de vil nok ligne noe av det vi så tidligere:</p> <figure><img src='+t(3595)+' alt=""></figure> <p>Dette er en god begynnelse, men det kan forenkles ytterligere. Om vi plasserer pillene med klokken (starter på toppen), og setter dem sammen i èn får vi noe som ser slik ut:</p> <figure><img src='+t(3596)+' alt=""></figure> <p>Her er <strong>x</strong> antall skritt vi først må flytte frem og deretter tilbake. Denne <strong>x</strong>\'en blir <em>parameteren</em> til vår funksjon.</p> </section> <section id=parametere> <h4 id=parametere>Parametere</h4> <p>Ovenfor har vi et pilsymbol som minner om de tidligere symbolene, men vi har også introdusert en måte å inkludere mer informasjon om hvor mange ganger vi vil at pilene framover og bakover skal brukes. I dataverdenen blir denne ekstra informasjonen kalt <em>parameter</em>. Disse parametrene kan brukes for å tilpasse allerede nyttige funksjoner til flere forskjellige situasjoner.</p> </section> <section id=omstabling> <h4 id=omstabling>Omstabling</h4> <p>Nå som klassen har dette nye symbolet kan de prøve å løse en av de mer krevende koppestablefigurene. Gruppene kan samarbeide om de trenger ekstra kopper.</p> </section> </section> '},3589:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_01.871496.jpg"},3590:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_02.a76d55.jpg"},3591:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_03.e627b0.jpg"},3592:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_04.020867.jpg"},3593:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_05.5ef19a.png"},3594:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_06.b73d7e.jpg"},3595:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/eksempel_07.c53c06.jpg"},3596:function(e,r){e.exports="data:image/jpeg;base64,"},3597:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/robotvenner-i-aksjon.079238.jpg"},3598:function(e,r,t){e.exports=t.p+"_/oppgaver/src/uten_datamaskin/robotvenner/robotvenner-smaa-bilder.dc7d2f.jpg"}});